import { Link } from "react-router-dom";

import styled from "styled-components";

const NotFoundBlockWrapper = styled.div`
  background-color: #ececec;
  height: 820px;
  width: 101%;
  position: relative;
  bottom: 5px;
  right: 7px;

  img {
    width: 700px;
    height: 300px;
    margin-top: 200px;
    margin-left: 350px;
  }

  h1 {
    margin-left: 335px;
  }
  button {
    margin-left: 615px;
    width: 168px;
    height: 48px;
    border-radius: 20px;
    background: #ac3634;
    border: none;
    cursor: pointer;
    color: #fff;
    font-size: 15px;
  }
`;

const NotFoundBlock: React.FC = () => {
  return (
    <div className="not__found__block">
      <img src="img/error3.png" alt="Error" />
      <h1>Извините, но данной страницы не существует</h1>
      <Link to="">
        <button>НА ГЛАВНУЮ</button>
      </Link>
    </div>
  );
};

export default NotFoundBlock;
